import React from "react";
import "./NewExpenseItem.css";
import ExpenseItem from "./ExpenseItem";
import App from "../App";

function NewExpensesItem() {
  return (
    <div className="expenses">
      <ExpenseItem
        title={App.expenses[0].title}
        amount={App.expenses[0].amount}
        date={App.expenses[0].date}
      />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default NewExpensesItem;
